import "./Profile.css";

const Profile = ({name,age,country}) => {
  return (
    <div className="profile">
      <h3>{name}</h3>
      <h3>{props.age}</h3>
      <h3>{props.country}</h3>
    </div>
  );
};


export default Profile;
